import { createSlice } from '@reduxjs/toolkit'

const donViDangKyDuThiReducer = createSlice({
  name: 'donViDangKyDuThi',
  initialState: { id: 0, datas: [] },
  reducers: {
    setDonViDangKyDuThiId: (state, action) => {
      return { ...state, id: action.payload }
    },
    setDonViDangKyDuThis: (state, action) => {
      return { ...state, datas: action.payload }
    },
  },
})
const { actions, reducer } = donViDangKyDuThiReducer
export const { setDonViDangKyDuThiId, setDonViDangKyDuThis } = actions
export default reducer
